        return a >= 1 and a <= 100
    def solve(a: int, k: int) -> int:
        if is_valid(a, k):
            return a
        left, right = a
        is_left = solve(left, k)
        is_right = solve(right, k)
        return max(is_left, is_right)
    return solve(a, k)


