class Solution:
    def gcdOfStrings(self, str1: str, str2: str) -> int:
        def gcd(a, b):
            while b:
                a, b = b, a % b
            return a

        l1 = len(str1)
        l2 = len(str2)

        if l1 < l2:
            return self.gcdOfStrings(str1, str2)

        s1 = set(str1)
        s2 = set(str2)

        i = 1

        while i < l1 + l2:
            if s1.intersection(s2):
                i += 1
            s2 = s1 - s2
            s1 = s2 - s1

        return gcd(l1, l2)

